import React from 'react';
import data from './data/data.json';
import { MemoryInfoCard, MemoryText } from './styles/Dashboard.styles';

const Memory = ({ id }) => {
    return(
        <MemoryInfoCard>
            {data[id].memory ? (
                <MemoryText>Fuck?</MemoryText>
            ): 
                <MemoryText>No Memory Found</MemoryText>
            }
        </MemoryInfoCard>
    )
}

export default Memory;
